 Age)</td>\r\n<td style="border: none; border-bottom: 1px dotted;">: 1988-09-03</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">ধর্মঃ (Religion)</td>\r\n<td style="border: none; border-bottom: 1px dotted;">: Islam</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">জাতীয়তাঃ (Nationality)</td>\r\n<td style="border: none; border-bottom: 1px dotted;">:</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">অভিজ্ঞতাঃ (Experience)</td>\r\n<td style="border: none; border-bottom: 1px dotted;">: 2 Year(s)</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">সুপারিশকারীর নাম ও পরিচিতি/ঠিকানাঃ (Name and Address of recommender)</td>\r\n<td style="border: none; border-bottom: 1px dotted;">:</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" colspan="2">\r\n<p>অতএব, অনুগ্রহ করে আমাকে উক্ত পদে নিয়োগ দান করিয়া বাধিত করিবেন।</p>\r\n<p>May I, therefore pray and hope that you would be kind enough to appoint me for the above post.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">আপনার বিশ্বস্ত</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">Your Faithfully,</td>\r\n</tr>\r\n<tr>\r\n<td style="border: none;" width="290px">তারিখ</td>\r\n<td style="border: none;">:</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style="border: 1px solid;" width="100%" cellpadding="3">\r\n<tbody>\r\n<tr style="width: 100%;">\r\n<td style="border: none; text-align: right;" colspan="2">(অফিস কর্তৃক পূরণীয় For office use only)</td>\r\n</tr>\r\n<tr style="width: 100%;">\r\n<td style="border: none;">১ লাইন নং (Dept) :</td>\r\n<td style="border: none;">৪. নিয়োগের তারিখ (Date of App) : 2018-11-02</td>\r\n</tr>\r\n<tr style="width: 100%;">\r\n<td style="border: none;">২. পুর্ণ নাম (Full Name) :</td>\r\n<td style="border: none;">৫. নির্ধারিত বেতন (Negotiated Salary) :</td>\r\n</tr>\r\n<tr style="width: 100%;">\r\n<td style="border: none;">৩. কার্ড নং (Card Number) : 18L020002E</td>\r\n</tr>\r\n<tr style="width: 100%;">\r\n