INSERT INTO `hr_letter` (`hr_letter_id`, `hr_letter_as_id`, `hr_letter_full`) VALUES
	(1, '18D002011H', '<p>তারিখঃ&nbsp;</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ</p>\r\n<p>মাতার নামঃ</p>\r\n<p>&nbsp;</p>\r\n<p>গ্রামঃ&nbsp; ডাকঘরঃ</p>\r\n<p>থানাঃ জেলাঃ</p>\r\n<p>\\r\\n</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>\\r\\n</p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত আপনাকে......................................................</p>\r\n<p>\\r\\n</p>\r\n<p>১। আপনি চাকুরীতে প্রথম............</p>\r\n<p>\\r\\n</p>\r\n<p>&nbsp;</p>\r\n<p>\\r\\n</p>\r\n<p>২। সাধারন কর্মঘন্টা......।।</p>\r\n<p>\\r\\n</p>\r\n<p>৩। সাধারণ ছুটিঃ</p>\r\n<p>\\r\\n</p>\r\n<ul>\\r\\n\r\n<li>শুক্রবার সাপ্তাহিক ছুটি</li>\r\n\\r\\n\r\n<li>অন্যান্য ছুটি\\r\\n\r\n<ul>\\r\\n\r\n<li>উৎসব</li>\r\n\\r\\n\r\n<li>নৈমিত্তিক</li>\r\n\\r\\n</ul>\r\n\\r\\n</li>\r\n\\r\\n</ul>\r\n<p>\\r\\n</p>\r\n<p>৪। পরিচয়......</p>\r\n<p>\\r\\n</p>\r\n<p>&nbsp;</p>\r\n<p>\\r\\n</p>\r\n<p>ধন্যবাদ&nbsp;</p>\r\n<p>\\r\\n</p>\r\n<p style="text-align: right;">&nbsp;কতৃপক্ষ&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(2, '17G100010N', '<center><strong>বেক্সিমকো ফ্যাশন লিমিটেড </strong></center><center><u> ১৭ ধানমন্ডি আর / এ, রোড নং ২, ঢাকা-১২০৫ </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-০৭-১৭ ১২:৪৯:০৯</p>\r\n<p>জনাব/জনাবাঃ জান্নাত আরা</p>\r\n<p>পিতা/স্বামীর নামঃ ফজলুল করিম/জলিল উদ্দিন</p>\r\n<p>মাতার নামঃ উম্মে হাবিবা</p>\r\n<p>গ্রামঃনাজিরা-বাপারী পারা&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ কুড়িগ্রাম</p>\r\n<p>থানাঃ কুড়িগ্রাম সদর &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ কুড়িগ্রাম</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার উৎপাদন বিভাগে সিনিয়র অপারেটর পদে প্রতি মাসে সর্বসাকুল্যে মোট টাকা বেতনে ২০তম গ্রেডে নিয়োগ দেওয়ার সিদ্ধান্ত করিয়াছেন, যাহা ২০১৭-০৭-১৭ তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল তিন মাস অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী বলে গণ্য হবেন।</p>\r\n<p>২। সাধারন কর্মঘন্টা ০৮ (আট) ঘন্টা এবং মধ্যাহ্ন বিরতি ৬০ মিনিট।</p>\r\n<p>৩। অতিরিক্ত সময় (ও.টি) ইহা মূল বেতনের দ্বিগুন। ( মূল বেতন/২০৮*২*মোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>৪। সাধারণ ছুটিঃ-</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ক) উৎসব ছুটিঃ- ১১ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;খ) নৈমিত্তিক ছুটিঃ- ১০ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;গ) বার্ষিক ছুটিঃ- ০১ (এক) বৎসর অতিবাহিত হওয়ার পর আপনি প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটী ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ঘ) অসুস্থতা জনিত ছুটিঃ- অসুস্থতাজনিত ছুটি বৎসরে মোট ১৪ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ঙ) মাতৃত্ব কালীন ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে অকাধিক্রমে ০৬ (ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;পারিবেন।</p>\r\n<p>৪। পরিচয় পত্রঃ- আপনাকে পরিচয়পত্র দেওয়া হইবে। আপনি কারখানায় প্রবেশের পূর্বে এবং বের হওয়ার সময় পরিচয় পতের ইলেক্ট্রনিক হাজিরা মেশিনের দ্বারা পাঞ্চ করিবেন এবং উক্ত পাঞ্চ মেশিন থেকে আপনার মাসিক হাজিরা এবং অতিরিক্ত সময় বের করা হইবে।</p>\r\n<p>৬। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতীরেকে বিনা নোটিশে আপনার চাকরীর অবসান করিতে পারিবেন, অথবা আপনিও চাকরি থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>৭।&nbsp;চাকুরী স্থায়ী হইবার পর আপনি স্বেচ্ছায় চাকরী হইতে অব্যহতি নিতে চাইলে কতৃপক্ষ কে ৬০ (ষাট) দিন পূর্বে লিখিত নোটিশের মাধ্যমে জানাইতে হবে।</p>\r\n<p>৮। চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকরীর অবসান করিতে চাহিলে ১২০ (একশত বিশ) দিনের লিখিত নোটিশ অথবা&nbsp;১২০ (একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>৯। আপনার চাকরী কোম্পানী কতৃক জারিকৃত বিধান ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১০। কতৃপক্ষ আপনাকে প্রয়োজন বোধে এই প্রতিষ্ঠাবের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলী করিতে পারিবেন।</p>\r\n<p>১১। কোম্পানীর যাবতীয় নিয়মকানুন পরিবর্তনযোগ্য (যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তিত নিয়ম কানুন সর্বদা মানিয়া চলিতে&nbsp; &nbsp; &nbsp; &nbsp;বাধ্য থাকিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;আপনার আই.ডি. নং- 17G100010N</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;আপনার জাতীয় পরিচয়পত্র নং- 123456789123456</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(3, '18A100009N', '<center><strong>বেক্সিমকো ফ্যাশন লিমিটেড </strong></center><center><u> ১৭ ধানমন্ডি আর / এ, রোড নং ২, ঢাকা-১২০৫ </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-০৭-১৭ ১২:৫১:০৯</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p>গ্রামঃ&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>থানাঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার উৎপাদন বিভাগে কাটার ম্যান পদে প্রতি মাসে সর্বসাকুল্যে মোট ১০০০০ টাকা বেতনে ২০তম গ্রেডে নিয়োগ দেওয়ার সিদ্ধান্ত করিয়াছেন, যাহা ২০১৮-০১-১৭ তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল তিন মাস অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী বলে গণ্য হবেন।</p>\r\n<p>২। সাধারন কর্মঘন্টা ০৮ (আট) ঘন্টা এবং মধ্যাহ্ন বিরতি ৬০ মিনিট।</p>\r\n<p>৩। অতিরিক্ত সময় (ও.টি) ইহা মূল বেতনের দ্বিগুন। ( মূল বেতন/২০৮*২*মোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>৪। সাধারণ ছুটিঃ-</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ক) উৎসব ছুটিঃ- ১১ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;খ) নৈমিত্তিক ছুটিঃ- ১০ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;গ) বার্ষিক ছুটিঃ- ০১ (এক) বৎসর অতিবাহিত হওয়ার পর আপনি প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটী ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ঘ) অসুস্থতা জনিত ছুটিঃ- অসুস্থতাজনিত ছুটি বৎসরে মোট ১৪ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ঙ) মাতৃত্ব কালীন ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে অকাধিক্রমে ০৬ (ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;পারিবেন।</p>\r\n<p>৪। পরিচয় পত্রঃ- আপনাকে পরিচয়পত্র দেওয়া হইবে। আপনি কারখানায় প্রবেশের পূর্বে এবং বের হওয়ার সময় পরিচয় পতের ইলেক্ট্রনিক হাজিরা মেশিনের দ্বারা পাঞ্চ করিবেন এবং উক্ত পাঞ্চ মেশিন থেকে আপনার মাসিক হাজিরা এবং অতিরিক্ত সময় বের করা হইবে।</p>\r\n<p>৬। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতীরেকে বিনা নোটিশে আপনার চাকরীর অবসান করিতে পারিবেন, অথবা আপনিও চাকরি থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>৭।&nbsp;চাকুরী স্থায়ী হইবার পর আপনি স্বেচ্ছায় চাকরী হইতে অব্যহতি নিতে চাইলে কতৃপক্ষ কে ৬০ (ষাট) দিন পূর্বে লিখিত নোটিশের মাধ্যমে জানাইতে হবে।</p>\r\n<p>৮। চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকরীর অবসান করিতে চাহিলে ১২০ (একশত বিশ) দিনের লিখিত নোটিশ অথবা&nbsp;১২০ (একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>৯। আপনার চাকরী কোম্পানী কতৃক জারিকৃত বিধান ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১০। কতৃপক্ষ আপনাকে প্রয়োজন বোধে এই প্রতিষ্ঠাবের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলী করিতে পারিবেন।</p>\r\n<p>১১। কোম্পানীর যাবতীয় নিয়মকানুন পরিবর্তনযোগ্য (যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তিত নিয়ম কানুন সর্বদা মানিয়া চলিতে&nbsp; &nbsp; &nbsp; &nbsp;বাধ্য থাকিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;আপনার আই.ডি. নং-</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;আপনার জাতীয় পরিচয়পত্র নং- 123456</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(4, '08E020001E', '<center></center><center><u> </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-০৭-১৭ ১২:৫২:১৩</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p>গ্রামঃ&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>থানাঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার বিভাগে পদে প্রতি মাসে সর্বসাকুল্যে মোট টাকা বেতনে ২০তম গ্রেডে নিয়োগ দেওয়ার সিদ্ধান্ত করিয়াছেন, যাহা ২০০৮-০৫-০৮ তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল তিন মাস অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী বলে গণ্য হবেন।</p>\r\n<p>২। সাধারন কর্মঘন্টা ০৮ (আট) ঘন্টা এবং মধ্যাহ্ন বিরতি ৬০ মিনিট।</p>\r\n<p>৩। অতিরিক্ত সময় (ও.টি) ইহা মূল বেতনের দ্বিগুন। ( মূল বেতন/২০৮*২*মোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>৪। সাধারণ ছুটিঃ-</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ক) উৎসব ছুটিঃ- ১১ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;খ) নৈমিত্তিক ছুটিঃ- ১০ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;গ) বার্ষিক ছুটিঃ- ০১ (এক) বৎসর অতিবাহিত হওয়ার পর আপনি প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটী ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ঘ) অসুস্থতা জনিত ছুটিঃ- অসুস্থতাজনিত ছুটি বৎসরে মোট ১৪ দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;ঙ) মাতৃত্ব কালীন ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে অকাধিক্রমে ০৬ (ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;পারিবেন।</p>\r\n<p>৪। পরিচয় পত্রঃ- আপনাকে পরিচয়পত্র দেওয়া হইবে। আপনি কারখানায় প্রবেশের পূর্বে এবং বের হওয়ার সময় পরিচয় পতের ইলেক্ট্রনিক হাজিরা মেশিনের দ্বারা পাঞ্চ করিবেন এবং উক্ত পাঞ্চ মেশিন থেকে আপনার মাসিক হাজিরা এবং অতিরিক্ত সময় বের করা হইবে।</p>\r\n<p>৬। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতীরেকে বিনা নোটিশে আপনার চাকরীর অবসান করিতে পারিবেন, অথবা আপনিও চাকরি থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>৭।&nbsp;চাকুরী স্থায়ী হইবার পর আপনি স্বেচ্ছায় চাকরী হইতে অব্যহতি নিতে চাইলে কতৃপক্ষ কে ৬০ (ষাট) দিন পূর্বে লিখিত নোটিশের মাধ্যমে জানাইতে হবে।</p>\r\n<p>৮। চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকরীর অবসান করিতে চাহিলে ১২০ (একশত বিশ) দিনের লিখিত নোটিশ অথবা&nbsp;১২০ (একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>৯। আপনার চাকরী কোম্পানী কতৃক জারিকৃত বিধান ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১০। কতৃপক্ষ আপনাকে প্রয়োজন বোধে এই প্রতিষ্ঠাবের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলী করিতে পারিবেন।</p>\r\n<p>১১। কোম্পানীর যাবতীয় নিয়মকানুন পরিবর্তনযোগ্য (যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তিত নিয়ম কানুন সর্বদা মানিয়া চলিতে&nbsp; &nbsp; &nbsp; &nbsp;বাধ্য থাকিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;আপনার আই.ডি. নং-</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;আপনার জাতীয় পরিচয়পত্র নং-</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(5, '17F005001B', '<center></center><center><u> </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-১০-২৭ ১৪:১০:৩৫ ইং</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p><strong>ঠিকানাঃ স্থায়ী ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ কলাবাগান &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ঢাকা</p>\r\n<p><strong>অস্থায়ী/বর্তমান ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ কলাবাগান &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ঢাকা</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত জানাচ্ছে যে, আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার <strong>এ আমি ডি</strong> পদে প্রতি মাসে সর্বসাকুল্যে মোট ৫০০০০ টাকা বেতনে গ্রেডঃ _ _ _ _ _ _ নিয়োগ দেওয়ার সিদ্ধান্ত গ্রহণ করিয়াছেন, আপনার পরিচয় পত্র নং(আই.ডি. নং)-<strong>17F005001B</strong> যাহা <strong>২০১৭-০৬-১৭</strong> তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী শ্রমিক হিসাবে গণ্য হবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>২। <strong> বেতনঃ</strong></p>\r\n<p>ক) মূল বেতন( Monthly Basic Pay )&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৪২০০০/= অতিরিক্ত কর্ম ঘন্টার হারঃ ৪০৩.৮৫ টাকা</p>\r\n<p>খ) বাড়ী ভাড়া(House Rent-40% of Basic Pay)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>গ) চিকিৎসা ভাতা(Medical Allowance)&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>ঘ) খাদ্য ভাতা(Food Allowance)&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>ঙ) যাতায়াত ভাতা(Conveyance Allowance) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>সর্বমোট বেতন( Monthly Gross Salary ) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০০/=</p>\r\n<p style="text-align: center;">বেতন প্রদানঃ প্রতি মাসের বেতন পরবর্তী মাসের সাত কর্ম দিবসের মধ্যে বেতন এবং ওভার টাইম এক সঙ্গে প্রদান করা হয়।</p>\r\n<p>&nbsp;</p>\r\n<p>৩। কর্ম ঘন্টাঃ ফ্যাক্টরি সকাল ৮.০০ থেকে শুরু এবং বিকাল ৫.০০ টায় সাধারণ কর্মদিবসের সমাপ্তি এবং মধ্যবর্তী সময়ে ০১(এক) ঘণ্টা বিরতি।</p>\r\n<p>৪। অতিরিক্ত কর্মঘন্টা (ওভার টাইম) ঃ ইহা মূল বেতনের দ্বিগুন হারে প্রদেয়। ( মূল বেতন/২০৮x২xমোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>&nbsp;</p>\r\n<p>৫।<strong> ছুটিঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) নৈমিত্তিক ছুটিঃ বছরে ১০(দশ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতা জনিত ছুটিঃ বছরে ১৪(চৌদ্দ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) উৎসব ছুটিঃ বছরে ১১(এগার) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) অর্জিত ছুটিঃ- ০১(এক) বৎসর অতিবাহিত হওয়ার পর প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটি ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) মাতৃকল্যাণ ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে একাধিক্রমে ০৬(ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে পারিবেন। ২০০৬ সালের মাতৃকল্যাণ আইনের ধারা অনুযায়ী মোট ১৬ সপ্তাহ বা (৫৬+৫৬)=১১২ দিন মাতৃত্বকালীন ছুটি (আইনানুগ ও নগদে) ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৬। <strong> সুবিধা</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) মূল মজুরীর ৫% হারে বাৎসরিক ভিত্তিতে মজুরী বৃদ্ধি পাইবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) যারা নিরবিচ্ছিন্নভাবে ১(এক) বৎসর চাকরি পূর্ণ করিয়াছেন তাহাদেরকে বৎসরে দুইটি উৎসব ভাতা প্রদান করা হইবে(প্রতিটি উৎসব ভাতা মূল বেতনের সমান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) মাসের প্রতিটি কর্মদিনের সঠিক সময়ে ফ্যাক্টরিতে উপস্থিত হলে প্রথম মাস ৪০০/= টাকা এবং একইভাবে পরবর্তী মাসে উপস্থিত থাকলে ৫০০/= হারে হাজিরা বোনাস প্রদান করা হয়। (ইহা আইনানুনাগ কোন পাওনা নয়। ইহা বেতনের বাহিরের একটি অংশ। )</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) বিনা খরচে ডাক্তার এবং নার্সের মাধ্যমে চিকিৎসা প্রদান করা হয়।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) শ্রমিক/কর্মচারীর জন্য গ্রুপ ইন্স্যুরেন্স এর ব্যবস্থা আছে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>৭। <strong> চাকুরি ছাড়ার নিয়মঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) চাকুরী ছাড়তে হলে বাংলাদেশ শ্রম আইন, ২০০৬ অনুসারে ২৭(১) ধারা মোতাবেক চাকুরী ছাড়ার ২ মাস(৬০ দিন) আগে কতৃপক্ষকে লিখিত নোটিশ প্রদান করতে হবে, অন্যথায় প্রদেয় নোটিশের পরিবর্তে নোটিশ মেয়াদের জন্য মজুরীর সমপরিমাণ অর্থ মালিককে প্রদান করিয়া ইহা করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতার কারণে চাকুরী ছেড়ে দিতে হলে মেডিকেল সার্টিফিকেট দাখিল করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) চাকুরী ছাড়ার পর কোম্পানীর প্রদত্ত মালামাল অর্থাৎ পরিচয় পত্র, লকারের চাবি, ড্রেস, কাটার, টেপ ইত্যাদি মানব সম্পদ বিভাগে জমা প্রদান করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকুরী অবসান করিতে চাহিলে ১২০(একশত বিশ) দিনের লিখিত নোটিশ অথবা ১২০(একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৮। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতিরেকে বিনা নোটিশে আপনার চাকুরী অবসান করিতে পারিবেন অথবা আপনিও চাকুরী থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৯। <strong> বাংলাদেশের শ্রম আইন, ২০০৬ অনুসারে ধারা ২৩(৪) মোতাবেক নিম্নলিখিত কাজসমূহ "অসদাচরণ"</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ক) উপরস্থের কোন আইন সংগত বা যুক্তি সংগত আদেশ মানার ক্ষেত্রে এককভাবে বা অন্যের সঙ্গে সংঘবদ্ধ হইয়া ইচ্ছাকৃত ভাবে অবাধ্যতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(খ) মালিকের ব্যবসা বা সম্পত্তি সম্পর্কে চুরি আত্মসাৎ, প্রতারণা বা অসাধুতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(গ) মালিকের অধীন তাহার বা অন্য কোন শ্রমিকের চাকুরী সংক্রান্ত ব্যাপারে ঘুষ গ্রহণ বা প্রদান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঘ) বিনা ছুটিতে অভ্যাসগত অনুপস্থিতি অথবা ছুটি না নিয়া একসঙ্গে ১০ (দশ) দিনের অধিক সময় অনুপস্থিতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঙ) অভ্যাসগত বিলম্ব।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(চ) প্রতিষ্ঠানে প্রযোজ্য কোন আইন, বিধি বা প্রবিধানের অভ্যাসগত লঙ্ঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ছ) প্রতিষ্ঠানে উচ্ছৃংখল বা দাংগা হাংগামা, অগ্নিসংযোগ বা ভাংচুর।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(জ) কাজে কর্মে অভ্যাসগত গাফিলতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঝ) প্রধান পরিদর্শক কর্তৃক অনুমোদিত চাকুরী সংক্রান্ত আত্নশৃংখল বা আচরণসহ, যে কোন বিধির অভ্যাসগত লংঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঞ) মালিকের অফিসিয়াল রেকর্ডের রদবদল, জালকরণ, অন্যায় পরিবর্তন, উহার ক্ষতিকরন বা উহা হারাইয়া ফেলা।</p>\r\n<p>আপনি যদি কখনো কোনরুপ অসদাচরণের অপরাধে দোষী প্রমাণিত হন তবে কতৃপক্ষ আপনার বিরুদ্ধে আইনগত শাস্তিমূলক ব্যবস্থা গ্রহণ করিতে পারবে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>১০। আপনার চাকুরী কোম্পানী কর্তৃক জারিকৃত বিধি ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১১। কর্তৃপক্ষ আপনাকে প্রয়োজনবোধে এই প্রতিষ্ঠানের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলি করিতে পারিবেন।</p>\r\n<p>১২। কোম্পানীর যাবতীয় নিয়ম-কানুন পরিবর্তনযোগ্য ( যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তীত নিয়ম কানুন সর্বদা মানিয়া চলিতে বাধ্য থাকিবেন।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(6, '17F005001B', '<center></center><center><u> </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-১০-৩০ ১০:২৭:৫১ ইং</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p><strong>ঠিকানাঃ স্থায়ী ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ কলাবাগান &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ঢাকা</p>\r\n<p><strong>অস্থায়ী/বর্তমান ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ কলাবাগান &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ঢাকা</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত জানাচ্ছে যে, আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার <strong>এ আমি ডি</strong> পদে প্রতি মাসে সর্বসাকুল্যে মোট ৫০০০০ টাকা বেতনে গ্রেডঃ _ _ _ _ _ _ নিয়োগ দেওয়ার সিদ্ধান্ত গ্রহণ করিয়াছেন, আপনার পরিচয় পত্র নং(আই.ডি. নং)-<strong>17F005001B</strong> যাহা <strong>২০১৭-০৬-১৭</strong> তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী শ্রমিক হিসাবে গণ্য হবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>২। <strong> বেতনঃ</strong></p>\r\n<p>ক) মূল বেতন( Monthly Basic Pay )&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৪২০০০/= অতিরিক্ত কর্ম ঘন্টার হারঃ ৪০৩.৮৫ টাকা</p>\r\n<p>খ) বাড়ী ভাড়া(House Rent-40% of Basic Pay)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>গ) চিকিৎসা ভাতা(Medical Allowance)&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>ঘ) খাদ্য ভাতা(Food Allowance)&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>ঙ) যাতায়াত ভাতা(Conveyance Allowance) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>সর্বমোট বেতন( Monthly Gross Salary ) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০০/=</p>\r\n<p style="text-align: center;">বেতন প্রদানঃ প্রতি মাসের বেতন পরবর্তী মাসের সাত কর্ম দিবসের মধ্যে বেতন এবং ওভার টাইম এক সঙ্গে প্রদান করা হয়।</p>\r\n<p>&nbsp;</p>\r\n<p>৩। কর্ম ঘন্টাঃ ফ্যাক্টরি সকাল ৮.০০ থেকে শুরু এবং বিকাল ৫.০০ টায় সাধারণ কর্মদিবসের সমাপ্তি এবং মধ্যবর্তী সময়ে ০১(এক) ঘণ্টা বিরতি।</p>\r\n<p>৪। অতিরিক্ত কর্মঘন্টা (ওভার টাইম) ঃ ইহা মূল বেতনের দ্বিগুন হারে প্রদেয়। ( মূল বেতন/২০৮x২xমোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>&nbsp;</p>\r\n<p>৫।<strong> ছুটিঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) নৈমিত্তিক ছুটিঃ বছরে ১০(দশ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতা জনিত ছুটিঃ বছরে ১৪(চৌদ্দ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) উৎসব ছুটিঃ বছরে ১১(এগার) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) অর্জিত ছুটিঃ- ০১(এক) বৎসর অতিবাহিত হওয়ার পর প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটি ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) মাতৃকল্যাণ ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে একাধিক্রমে ০৬(ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে পারিবেন। ২০০৬ সালের মাতৃকল্যাণ আইনের ধারা অনুযায়ী মোট ১৬ সপ্তাহ বা (৫৬+৫৬)=১১২ দিন মাতৃত্বকালীন ছুটি (আইনানুগ ও নগদে) ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৬। <strong> সুবিধা</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) মূল মজুরীর ৫% হারে বাৎসরিক ভিত্তিতে মজুরী বৃদ্ধি পাইবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) যারা নিরবিচ্ছিন্নভাবে ১(এক) বৎসর চাকরি পূর্ণ করিয়াছেন তাহাদেরকে বৎসরে দুইটি উৎসব ভাতা প্রদান করা হইবে(প্রতিটি উৎসব ভাতা মূল বেতনের সমান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) মাসের প্রতিটি কর্মদিনের সঠিক সময়ে ফ্যাক্টরিতে উপস্থিত হলে প্রথম মাস ৪০০/= টাকা এবং একইভাবে পরবর্তী মাসে উপস্থিত থাকলে ৫০০/= হারে হাজিরা বোনাস প্রদান করা হয়। (ইহা আইনানুনাগ কোন পাওনা নয়। ইহা বেতনের বাহিরের একটি অংশ। )</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) বিনা খরচে ডাক্তার এবং নার্সের মাধ্যমে চিকিৎসা প্রদান করা হয়।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) শ্রমিক/কর্মচারীর জন্য গ্রুপ ইন্স্যুরেন্স এর ব্যবস্থা আছে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>৭। <strong> চাকুরি ছাড়ার নিয়মঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) চাকুরী ছাড়তে হলে বাংলাদেশ শ্রম আইন, ২০০৬ অনুসারে ২৭(১) ধারা মোতাবেক চাকুরী ছাড়ার ২ মাস(৬০ দিন) আগে কতৃপক্ষকে লিখিত নোটিশ প্রদান করতে হবে, অন্যথায় প্রদেয় নোটিশের পরিবর্তে নোটিশ মেয়াদের জন্য মজুরীর সমপরিমাণ অর্থ মালিককে প্রদান করিয়া ইহা করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতার কারণে চাকুরী ছেড়ে দিতে হলে মেডিকেল সার্টিফিকেট দাখিল করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) চাকুরী ছাড়ার পর কোম্পানীর প্রদত্ত মালামাল অর্থাৎ পরিচয় পত্র, লকারের চাবি, ড্রেস, কাটার, টেপ ইত্যাদি মানব সম্পদ বিভাগে জমা প্রদান করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকুরী অবসান করিতে চাহিলে ১২০(একশত বিশ) দিনের লিখিত নোটিশ অথবা ১২০(একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৮। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতিরেকে বিনা নোটিশে আপনার চাকুরী অবসান করিতে পারিবেন অথবা আপনিও চাকুরী থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৯। <strong> বাংলাদেশের শ্রম আইন, ২০০৬ অনুসারে ধারা ২৩(৪) মোতাবেক নিম্নলিখিত কাজসমূহ "অসদাচরণ"</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ক) উপরস্থের কোন আইন সংগত বা যুক্তি সংগত আদেশ মানার ক্ষেত্রে এককভাবে বা অন্যের সঙ্গে সংঘবদ্ধ হইয়া ইচ্ছাকৃত ভাবে অবাধ্যতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(খ) মালিকের ব্যবসা বা সম্পত্তি সম্পর্কে চুরি আত্মসাৎ, প্রতারণা বা অসাধুতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(গ) মালিকের অধীন তাহার বা অন্য কোন শ্রমিকের চাকুরী সংক্রান্ত ব্যাপারে ঘুষ গ্রহণ বা প্রদান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঘ) বিনা ছুটিতে অভ্যাসগত অনুপস্থিতি অথবা ছুটি না নিয়া একসঙ্গে ১০ (দশ) দিনের অধিক সময় অনুপস্থিতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঙ) অভ্যাসগত বিলম্ব।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(চ) প্রতিষ্ঠানে প্রযোজ্য কোন আইন, বিধি বা প্রবিধানের অভ্যাসগত লঙ্ঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ছ) প্রতিষ্ঠানে উচ্ছৃংখল বা দাংগা হাংগামা, অগ্নিসংযোগ বা ভাংচুর।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(জ) কাজে কর্মে অভ্যাসগত গাফিলতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঝ) প্রধান পরিদর্শক কর্তৃক অনুমোদিত চাকুরী সংক্রান্ত আত্নশৃংখল বা আচরণসহ, যে কোন বিধির অভ্যাসগত লংঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঞ) মালিকের অফিসিয়াল রেকর্ডের রদবদল, জালকরণ, অন্যায় পরিবর্তন, উহার ক্ষতিকরন বা উহা হারাইয়া ফেলা।</p>\r\n<p>আপনি যদি কখনো কোনরুপ অসদাচরণের অপরাধে দোষী প্রমাণিত হন তবে কতৃপক্ষ আপনার বিরুদ্ধে আইনগত শাস্তিমূলক ব্যবস্থা গ্রহণ করিতে পারবে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>১০। আপনার চাকুরী কোম্পানী কর্তৃক জারিকৃত বিধি ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১১। কর্তৃপক্ষ আপনাকে প্রয়োজনবোধে এই প্রতিষ্ঠানের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলি করিতে পারিবেন।</p>\r\n<p>১২। কোম্পানীর যাবতীয় নিয়ম-কানুন পরিবর্তনযোগ্য ( যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তীত নিয়ম কানুন সর্বদা মানিয়া চলিতে বাধ্য থাকিবেন।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(7, '17F005001B', '<center></center><center><u> </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-১০-৩০ ১০:২৮:০৫ ইং</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p><strong>ঠিকানাঃ স্থায়ী ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ কলাবাগান &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ঢাকা</p>\r\n<p><strong>অস্থায়ী/বর্তমান ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ কলাবাগান &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ঢাকা</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত জানাচ্ছে যে, আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার <strong>এ আমি ডি</strong> পদে প্রতি মাসে সর্বসাকুল্যে মোট ৫০০০০ টাকা বেতনে গ্রেডঃ _ _ _ _ _ _ নিয়োগ দেওয়ার সিদ্ধান্ত গ্রহণ করিয়াছেন, আপনার পরিচয় পত্র নং(আই.ডি. নং)-<strong>17F005001B</strong> যাহা <strong>২০১৭-০৬-১৭</strong> তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী শ্রমিক হিসাবে গণ্য হবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>২। <strong> বেতনঃ</strong></p>\r\n<p>ক) মূল বেতন( Monthly Basic Pay )&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৪২০০০/= অতিরিক্ত কর্ম ঘন্টার হারঃ ৪০৩.৮৫ টাকা</p>\r\n<p>খ) বাড়ী ভাড়া(House Rent-40% of Basic Pay)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>গ) চিকিৎসা ভাতা(Medical Allowance)&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>ঘ) খাদ্য ভাতা(Food Allowance)&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>ঙ) যাতায়াত ভাতা(Conveyance Allowance) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০/=</p>\r\n<p>সর্বমোট বেতন( Monthly Gross Salary ) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৭০০০০/=</p>\r\n<p style="text-align: center;">বেতন প্রদানঃ প্রতি মাসের বেতন পরবর্তী মাসের সাত কর্ম দিবসের মধ্যে বেতন এবং ওভার টাইম এক সঙ্গে প্রদান করা হয়।</p>\r\n<p>&nbsp;</p>\r\n<p>৩। কর্ম ঘন্টাঃ ফ্যাক্টরি সকাল ৮.০০ থেকে শুরু এবং বিকাল ৫.০০ টায় সাধারণ কর্মদিবসের সমাপ্তি এবং মধ্যবর্তী সময়ে ০১(এক) ঘণ্টা বিরতি।</p>\r\n<p>৪। অতিরিক্ত কর্মঘন্টা (ওভার টাইম) ঃ ইহা মূল বেতনের দ্বিগুন হারে প্রদেয়। ( মূল বেতন/২০৮x২xমোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>&nbsp;</p>\r\n<p>৫।<strong> ছুটিঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) নৈমিত্তিক ছুটিঃ বছরে ১০(দশ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতা জনিত ছুটিঃ বছরে ১৪(চৌদ্দ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) উৎসব ছুটিঃ বছরে ১১(এগার) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) অর্জিত ছুটিঃ- ০১(এক) বৎসর অতিবাহিত হওয়ার পর প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটি ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) মাতৃকল্যাণ ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে একাধিক্রমে ০৬(ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে পারিবেন। ২০০৬ সালের মাতৃকল্যাণ আইনের ধারা অনুযায়ী মোট ১৬ সপ্তাহ বা (৫৬+৫৬)=১১২ দিন মাতৃত্বকালীন ছুটি (আইনানুগ ও নগদে) ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৬। <strong> সুবিধা</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) মূল মজুরীর ৫% হারে বাৎসরিক ভিত্তিতে মজুরী বৃদ্ধি পাইবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) যারা নিরবিচ্ছিন্নভাবে ১(এক) বৎসর চাকরি পূর্ণ করিয়াছেন তাহাদেরকে বৎসরে দুইটি উৎসব ভাতা প্রদান করা হইবে(প্রতিটি উৎসব ভাতা মূল বেতনের সমান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) মাসের প্রতিটি কর্মদিনের সঠিক সময়ে ফ্যাক্টরিতে উপস্থিত হলে প্রথম মাস ৪০০/= টাকা এবং একইভাবে পরবর্তী মাসে উপস্থিত থাকলে ৫০০/= হারে হাজিরা বোনাস প্রদান করা হয়। (ইহা আইনানুনাগ কোন পাওনা নয়। ইহা বেতনের বাহিরের একটি অংশ। )</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) বিনা খরচে ডাক্তার এবং নার্সের মাধ্যমে চিকিৎসা প্রদান করা হয়।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) শ্রমিক/কর্মচারীর জন্য গ্রুপ ইন্স্যুরেন্স এর ব্যবস্থা আছে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>৭। <strong> চাকুরি ছাড়ার নিয়মঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) চাকুরী ছাড়তে হলে বাংলাদেশ শ্রম আইন, ২০০৬ অনুসারে ২৭(১) ধারা মোতাবেক চাকুরী ছাড়ার ২ মাস(৬০ দিন) আগে কতৃপক্ষকে লিখিত নোটিশ প্রদান করতে হবে, অন্যথায় প্রদেয় নোটিশের পরিবর্তে নোটিশ মেয়াদের জন্য মজুরীর সমপরিমাণ অর্থ মালিককে প্রদান করিয়া ইহা করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতার কারণে চাকুরী ছেড়ে দিতে হলে মেডিকেল সার্টিফিকেট দাখিল করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) চাকুরী ছাড়ার পর কোম্পানীর প্রদত্ত মালামাল অর্থাৎ পরিচয় পত্র, লকারের চাবি, ড্রেস, কাটার, টেপ ইত্যাদি মানব সম্পদ বিভাগে জমা প্রদান করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকুরী অবসান করিতে চাহিলে ১২০(একশত বিশ) দিনের লিখিত নোটিশ অথবা ১২০(একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৮। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতিরেকে বিনা নোটিশে আপনার চাকুরী অবসান করিতে পারিবেন অথবা আপনিও চাকুরী থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৯। <strong> বাংলাদেশের শ্রম আইন, ২০০৬ অনুসারে ধারা ২৩(৪) মোতাবেক নিম্নলিখিত কাজসমূহ "অসদাচরণ"</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ক) উপরস্থের কোন আইন সংগত বা যুক্তি সংগত আদেশ মানার ক্ষেত্রে এককভাবে বা অন্যের সঙ্গে সংঘবদ্ধ হইয়া ইচ্ছাকৃত ভাবে অবাধ্যতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(খ) মালিকের ব্যবসা বা সম্পত্তি সম্পর্কে চুরি আত্মসাৎ, প্রতারণা বা অসাধুতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(গ) মালিকের অধীন তাহার বা অন্য কোন শ্রমিকের চাকুরী সংক্রান্ত ব্যাপারে ঘুষ গ্রহণ বা প্রদান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঘ) বিনা ছুটিতে অভ্যাসগত অনুপস্থিতি অথবা ছুটি না নিয়া একসঙ্গে ১০ (দশ) দিনের অধিক সময় অনুপস্থিতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঙ) অভ্যাসগত বিলম্ব।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(চ) প্রতিষ্ঠানে প্রযোজ্য কোন আইন, বিধি বা প্রবিধানের অভ্যাসগত লঙ্ঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ছ) প্রতিষ্ঠানে উচ্ছৃংখল বা দাংগা হাংগামা, অগ্নিসংযোগ বা ভাংচুর।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(জ) কাজে কর্মে অভ্যাসগত গাফিলতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঝ) প্রধান পরিদর্শক কর্তৃক অনুমোদিত চাকুরী সংক্রান্ত আত্নশৃংখল বা আচরণসহ, যে কোন বিধির অভ্যাসগত লংঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঞ) মালিকের অফিসিয়াল রেকর্ডের রদবদল, জালকরণ, অন্যায় পরিবর্তন, উহার ক্ষতিকরন বা উহা হারাইয়া ফেলা।</p>\r\n<p>আপনি যদি কখনো কোনরুপ অসদাচরণের অপরাধে দোষী প্রমাণিত হন তবে কতৃপক্ষ আপনার বিরুদ্ধে আইনগত শাস্তিমূলক ব্যবস্থা গ্রহণ করিতে পারবে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>১০। আপনার চাকুরী কোম্পানী কর্তৃক জারিকৃত বিধি ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১১। কর্তৃপক্ষ আপনাকে প্রয়োজনবোধে এই প্রতিষ্ঠানের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলি করিতে পারিবেন।</p>\r\n<p>১২। কোম্পানীর যাবতীয় নিয়ম-কানুন পরিবর্তনযোগ্য ( যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তীত নিয়ম কানুন সর্বদা মানিয়া চলিতে বাধ্য থাকিবেন।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(8, '18G100011N', '<center><strong>অ্যাবসলিউট কোয়ালিটি ওয়ের লিমিটেড </strong></center><center><u> </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-১১-০৪ ১৩:৩২:২৬ ইং</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p><strong>ঠিকানাঃ স্থায়ী ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ মুক্তাগাছা &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ ময়মনসিংহ</p>\r\n<p><strong>অস্থায়ী/বর্তমান ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ গাজীপুর সদর &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ গাজীপুর</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত জানাচ্ছে যে, আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার <strong>অফিসার</strong> পদে প্রতি মাসে সর্বসাকুল্যে মোট ১৮০০০ টাকা বেতনে গ্রেডঃ _ _ _ _ _ _ নিয়োগ দেওয়ার সিদ্ধান্ত গ্রহণ করিয়াছেন, আপনার পরিচয় পত্র নং(আই.ডি. নং)-<strong>18G100011N</strong> যাহা <strong>২০১৮-০৭-১৮</strong> তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী শ্রমিক হিসাবে গণ্য হবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>২। <strong> বেতনঃ</strong></p>\r\n<p>ক) মূল বেতন( Monthly Basic Pay )&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ২৬৬/= অতিরিক্ত কর্ম ঘন্টার হারঃ ২.৫৬ টাকা</p>\r\n<p>খ) বাড়ী ভাড়া(House Rent-40% of Basic Pay)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা /=</p>\r\n<p>গ) চিকিৎসা ভাতা(Medical Allowance)&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;ঃ টাকা ৪৭৫০০/=</p>\r\n<p>ঘ) খাদ্য ভাতা(Food Allowance)&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৩৮০০০/=</p>\r\n<p>ঙ) যাতায়াত ভাতা(Conveyance Allowance) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ১২৩৫০০/=</p>\r\n<p>সর্বমোট বেতন( Monthly Gross Salary ) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ১৯০০০/=</p>\r\n<p style="text-align: center;">বেতন প্রদানঃ প্রতি মাসের বেতন পরবর্তী মাসের সাত কর্ম দিবসের মধ্যে বেতন এবং ওভার টাইম এক সঙ্গে প্রদান করা হয়।</p>\r\n<p>&nbsp;</p>\r\n<p>৩। কর্ম ঘন্টাঃ ফ্যাক্টরি সকাল ৮.০০ থেকে শুরু এবং বিকাল ৫.০০ টায় সাধারণ কর্মদিবসের সমাপ্তি এবং মধ্যবর্তী সময়ে ০১(এক) ঘণ্টা বিরতি।</p>\r\n<p>৪। অতিরিক্ত কর্মঘন্টা (ওভার টাইম) ঃ ইহা মূল বেতনের দ্বিগুন হারে প্রদেয়। ( মূল বেতন/২০৮x২xমোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>&nbsp;</p>\r\n<p>৫।<strong> ছুটিঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) নৈমিত্তিক ছুটিঃ বছরে ১০(দশ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতা জনিত ছুটিঃ বছরে ১৪(চৌদ্দ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) উৎসব ছুটিঃ বছরে ১১(এগার) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) অর্জিত ছুটিঃ- ০১(এক) বৎসর অতিবাহিত হওয়ার পর প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটি ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) মাতৃকল্যাণ ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে একাধিক্রমে ০৬(ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে পারিবেন। ২০০৬ সালের মাতৃকল্যাণ আইনের ধারা অনুযায়ী মোট ১৬ সপ্তাহ বা (৫৬+৫৬)=১১২ দিন মাতৃত্বকালীন ছুটি (আইনানুগ ও নগদে) ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৬। <strong> সুবিধা</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) মূল মজুরীর ৫% হারে বাৎসরিক ভিত্তিতে মজুরী বৃদ্ধি পাইবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) যারা নিরবিচ্ছিন্নভাবে ১(এক) বৎসর চাকরি পূর্ণ করিয়াছেন তাহাদেরকে বৎসরে দুইটি উৎসব ভাতা প্রদান করা হইবে(প্রতিটি উৎসব ভাতা মূল বেতনের সমান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) মাসের প্রতিটি কর্মদিনের সঠিক সময়ে ফ্যাক্টরিতে উপস্থিত হলে প্রথম মাস ৪০০/= টাকা এবং একইভাবে পরবর্তী মাসে উপস্থিত থাকলে ৫০০/= হারে হাজিরা বোনাস প্রদান করা হয়। (ইহা আইনানুনাগ কোন পাওনা নয়। ইহা বেতনের বাহিরের একটি অংশ। )</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) বিনা খরচে ডাক্তার এবং নার্সের মাধ্যমে চিকিৎসা প্রদান করা হয়।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) শ্রমিক/কর্মচারীর জন্য গ্রুপ ইন্স্যুরেন্স এর ব্যবস্থা আছে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>৭। <strong> চাকুরি ছাড়ার নিয়মঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) চাকুরী ছাড়তে হলে বাংলাদেশ শ্রম আইন, ২০০৬ অনুসারে ২৭(১) ধারা মোতাবেক চাকুরী ছাড়ার ২ মাস(৬০ দিন) আগে কতৃপক্ষকে লিখিত নোটিশ প্রদান করতে হবে, অন্যথায় প্রদেয় নোটিশের পরিবর্তে নোটিশ মেয়াদের জন্য মজুরীর সমপরিমাণ অর্থ মালিককে প্রদান করিয়া ইহা করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতার কারণে চাকুরী ছেড়ে দিতে হলে মেডিকেল সার্টিফিকেট দাখিল করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) চাকুরী ছাড়ার পর কোম্পানীর প্রদত্ত মালামাল অর্থাৎ পরিচয় পত্র, লকারের চাবি, ড্রেস, কাটার, টেপ ইত্যাদি মানব সম্পদ বিভাগে জমা প্রদান করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকুরী অবসান করিতে চাহিলে ১২০(একশত বিশ) দিনের লিখিত নোটিশ অথবা ১২০(একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৮। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতিরেকে বিনা নোটিশে আপনার চাকুরী অবসান করিতে পারিবেন অথবা আপনিও চাকুরী থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৯। <strong> বাংলাদেশের শ্রম আইন, ২০০৬ অনুসারে ধারা ২৩(৪) মোতাবেক নিম্নলিখিত কাজসমূহ "অসদাচরণ"</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ক) উপরস্থের কোন আইন সংগত বা যুক্তি সংগত আদেশ মানার ক্ষেত্রে এককভাবে বা অন্যের সঙ্গে সংঘবদ্ধ হইয়া ইচ্ছাকৃত ভাবে অবাধ্যতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(খ) মালিকের ব্যবসা বা সম্পত্তি সম্পর্কে চুরি আত্মসাৎ, প্রতারণা বা অসাধুতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(গ) মালিকের অধীন তাহার বা অন্য কোন শ্রমিকের চাকুরী সংক্রান্ত ব্যাপারে ঘুষ গ্রহণ বা প্রদান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঘ) বিনা ছুটিতে অভ্যাসগত অনুপস্থিতি অথবা ছুটি না নিয়া একসঙ্গে ১০ (দশ) দিনের অধিক সময় অনুপস্থিতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঙ) অভ্যাসগত বিলম্ব।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(চ) প্রতিষ্ঠানে প্রযোজ্য কোন আইন, বিধি বা প্রবিধানের অভ্যাসগত লঙ্ঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ছ) প্রতিষ্ঠানে উচ্ছৃংখল বা দাংগা হাংগামা, অগ্নিসংযোগ বা ভাংচুর।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(জ) কাজে কর্মে অভ্যাসগত গাফিলতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঝ) প্রধান পরিদর্শক কর্তৃক অনুমোদিত চাকুরী সংক্রান্ত আত্নশৃংখল বা আচরণসহ, যে কোন বিধির অভ্যাসগত লংঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঞ) মালিকের অফিসিয়াল রেকর্ডের রদবদল, জালকরণ, অন্যায় পরিবর্তন, উহার ক্ষতিকরন বা উহা হারাইয়া ফেলা।</p>\r\n<p>আপনি যদি কখনো কোনরুপ অসদাচরণের অপরাধে দোষী প্রমাণিত হন তবে কতৃপক্ষ আপনার বিরুদ্ধে আইনগত শাস্তিমূলক ব্যবস্থা গ্রহণ করিতে পারবে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>১০। আপনার চাকুরী কোম্পানী কর্তৃক জারিকৃত বিধি ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১১। কর্তৃপক্ষ আপনাকে প্রয়োজনবোধে এই প্রতিষ্ঠানের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলি করিতে পারিবেন।</p>\r\n<p>১২। কোম্পানীর যাবতীয় নিয়ম-কানুন পরিবর্তনযোগ্য ( যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তীত নিয়ম কানুন সর্বদা মানিয়া চলিতে বাধ্য থাকিবেন।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>'),
	(9, '18A100008N', '<center><strong>অ্যাবসলিউট কোয়ালিটি ওয়ের লিমিটেড </strong></center><center><u> </u></center>\r\n<p>তারিখঃ&nbsp; ২০১৮-১১-০৬ ১২:৫১:২৫ ইং</p>\r\n<p>জনাব/জনাবাঃ</p>\r\n<p>পিতা/স্বামীর নামঃ /</p>\r\n<p>মাতার নামঃ</p>\r\n<p><strong>ঠিকানাঃ স্থায়ী ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ বরগুনা সদর &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ বরগুনা</p>\r\n<p><strong>অস্থায়ী/বর্তমান ঠিকানাঃ</strong></p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ্রামঃ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; ডাকঘরঃ</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;থানাঃ গাজীপুর সদর &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; জেলাঃ গাজীপুর</p>\r\n<p><span style="text-decoration: underline;"><strong>বিষয়ঃ- নিয়োগপত্র</strong></span></p>\r\n<p>কতৃপক্ষ অত্যন্ত আনন্দের সহিত জানাচ্ছে যে, আপনাকে নিম্নলিখিত শর্তসাপেক্ষে অত্র কারখানার <strong>সাধারণ সেলাই মেশিন অপারেটর</strong> পদে প্রতি মাসে সর্বসাকুল্যে মোট ৮০০০ টাকা বেতনে গ্রেডঃ _ _ _ _ _ _ নিয়োগ দেওয়ার সিদ্ধান্ত গ্রহণ করিয়াছেন, আপনার পরিচয় পত্র নং(আই.ডি. নং)-<strong>18A100008N</strong> যাহা <strong>২০১৮-০১-০১</strong> তারিখ হইতে কার্যকরী।</p>\r\n<p>১। আপনি চাকুরীতে প্রথম ০৩ (তিন) মাস প্রবেশনারী অবস্থায় থাকিবেন এবং উক্ত সময়ের মধ্যে আপনার কর্মদক্ষতা সন্তোষজনক না হইলে আপনার প্রবেশনকাল আরও তিন মাস বর্ধিত করা যেতে পারে। প্রবেশনকাল অতিবাহিত হওয়ার পর আপনি সরাসরি স্থায়ী শ্রমিক হিসাবে গণ্য হবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>২। <strong> বেতনঃ</strong></p>\r\n<p>ক) মূল বেতন( Monthly Basic Pay )&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৪৯২৯/= অতিরিক্ত কর্ম ঘন্টার হারঃ ৪৭.৩৯ টাকা</p>\r\n<p>খ) বাড়ী ভাড়া(House Rent-40% of Basic Pay)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ১৯৭১/=</p>\r\n<p>গ) চিকিৎসা ভাতা(Medical Allowance)&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;ঃ টাকা ৬৫০/=</p>\r\n<p>ঘ) খাদ্য ভাতা(Food Allowance)&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ২৫০/=</p>\r\n<p>ঙ) যাতায়াত ভাতা(Conveyance Allowance) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ২০০/=</p>\r\n<p>সর্বমোট বেতন( Monthly Gross Salary ) &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঃ টাকা ৮০০০/=</p>\r\n<p style="text-align: center;">বেতন প্রদানঃ প্রতি মাসের বেতন পরবর্তী মাসের সাত কর্ম দিবসের মধ্যে বেতন এবং ওভার টাইম এক সঙ্গে প্রদান করা হয়।</p>\r\n<p>&nbsp;</p>\r\n<p>৩। কর্ম ঘন্টাঃ ফ্যাক্টরি সকাল ৮.০০ থেকে শুরু এবং বিকাল ৫.০০ টায় সাধারণ কর্মদিবসের সমাপ্তি এবং মধ্যবর্তী সময়ে ০১(এক) ঘণ্টা বিরতি।</p>\r\n<p>৪। অতিরিক্ত কর্মঘন্টা (ওভার টাইম) ঃ ইহা মূল বেতনের দ্বিগুন হারে প্রদেয়। ( মূল বেতন/২০৮x২xমোট অতিরিক্ত ঘন্টা)।</p>\r\n<p>&nbsp;</p>\r\n<p>৫।<strong> ছুটিঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;১। শুক্রবার সাপ্তাহিক ছুটি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;২। অন্যান্য ছুটি, (যাহা পূর্ণ বেতনে ভোগ করিতে পারিবেন।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) নৈমিত্তিক ছুটিঃ বছরে ১০(দশ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতা জনিত ছুটিঃ বছরে ১৪(চৌদ্দ) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) উৎসব ছুটিঃ বছরে ১১(এগার) দিন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) অর্জিত ছুটিঃ- ০১(এক) বৎসর অতিবাহিত হওয়ার পর প্রতি ১৮ কর্মদিবসের জন্য একদিন করে বার্ষিক ছুটি ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) মাতৃকল্যাণ ছুটিঃ- কোন মহিলা শ্রমিক যদি অত্র প্রতিষ্ঠানে একাধিক্রমে ০৬(ছয়) মাস চাকুরী করেন তাহলে তিনি উক্ত ছুটি ভোগ করিতে পারিবেন। ২০০৬ সালের মাতৃকল্যাণ আইনের ধারা অনুযায়ী মোট ১৬ সপ্তাহ বা (৫৬+৫৬)=১১২ দিন মাতৃত্বকালীন ছুটি (আইনানুগ ও নগদে) ভোগ করিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৬। <strong> সুবিধা</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) মূল মজুরীর ৫% হারে বাৎসরিক ভিত্তিতে মজুরী বৃদ্ধি পাইবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) যারা নিরবিচ্ছিন্নভাবে ১(এক) বৎসর চাকরি পূর্ণ করিয়াছেন তাহাদেরকে বৎসরে দুইটি উৎসব ভাতা প্রদান করা হইবে(প্রতিটি উৎসব ভাতা মূল বেতনের সমান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) মাসের প্রতিটি কর্মদিনের সঠিক সময়ে ফ্যাক্টরিতে উপস্থিত হলে প্রথম মাস ৪০০/= টাকা এবং একইভাবে পরবর্তী মাসে উপস্থিত থাকলে ৫০০/= হারে হাজিরা বোনাস প্রদান করা হয়। (ইহা আইনানুনাগ কোন পাওনা নয়। ইহা বেতনের বাহিরের একটি অংশ। )</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) বিনা খরচে ডাক্তার এবং নার্সের মাধ্যমে চিকিৎসা প্রদান করা হয়।&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঙ) শ্রমিক/কর্মচারীর জন্য গ্রুপ ইন্স্যুরেন্স এর ব্যবস্থা আছে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>৭। <strong> চাকুরি ছাড়ার নিয়মঃ</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ক) চাকুরী ছাড়তে হলে বাংলাদেশ শ্রম আইন, ২০০৬ অনুসারে ২৭(১) ধারা মোতাবেক চাকুরী ছাড়ার ২ মাস(৬০ দিন) আগে কতৃপক্ষকে লিখিত নোটিশ প্রদান করতে হবে, অন্যথায় প্রদেয় নোটিশের পরিবর্তে নোটিশ মেয়াদের জন্য মজুরীর সমপরিমাণ অর্থ মালিককে প্রদান করিয়া ইহা করিতে পারিবেন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;খ) অসুস্থতার কারণে চাকুরী ছেড়ে দিতে হলে মেডিকেল সার্টিফিকেট দাখিল করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;গ) চাকুরী ছাড়ার পর কোম্পানীর প্রদত্ত মালামাল অর্থাৎ পরিচয় পত্র, লকারের চাবি, ড্রেস, কাটার, টেপ ইত্যাদি মানব সম্পদ বিভাগে জমা প্রদান করতে হবে।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ঘ) চাকুরী স্থায়ী হইবার পর কতৃপক্ষ আপনার চাকুরী অবসান করিতে চাহিলে ১২০(একশত বিশ) দিনের লিখিত নোটিশ অথবা ১২০(একশত বিশ) দিনের বেতন প্রদান করিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৮। প্রবেশনারী থাকাকালীন সময়ে কোম্পানী যে কোন সময় কোন প্রকার কারণ দর্শানো ব্যতিরেকে বিনা নোটিশে আপনার চাকুরী অবসান করিতে পারিবেন অথবা আপনিও চাকুরী থেকে স্বেচ্ছায় ইস্তফা দিতে পারিবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>৯। <strong> বাংলাদেশের শ্রম আইন, ২০০৬ অনুসারে ধারা ২৩(৪) মোতাবেক নিম্নলিখিত কাজসমূহ "অসদাচরণ"</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ক) উপরস্থের কোন আইন সংগত বা যুক্তি সংগত আদেশ মানার ক্ষেত্রে এককভাবে বা অন্যের সঙ্গে সংঘবদ্ধ হইয়া ইচ্ছাকৃত ভাবে অবাধ্যতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(খ) মালিকের ব্যবসা বা সম্পত্তি সম্পর্কে চুরি আত্মসাৎ, প্রতারণা বা অসাধুতা।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(গ) মালিকের অধীন তাহার বা অন্য কোন শ্রমিকের চাকুরী সংক্রান্ত ব্যাপারে ঘুষ গ্রহণ বা প্রদান।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঘ) বিনা ছুটিতে অভ্যাসগত অনুপস্থিতি অথবা ছুটি না নিয়া একসঙ্গে ১০ (দশ) দিনের অধিক সময় অনুপস্থিতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঙ) অভ্যাসগত বিলম্ব।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(চ) প্রতিষ্ঠানে প্রযোজ্য কোন আইন, বিধি বা প্রবিধানের অভ্যাসগত লঙ্ঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ছ) প্রতিষ্ঠানে উচ্ছৃংখল বা দাংগা হাংগামা, অগ্নিসংযোগ বা ভাংচুর।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(জ) কাজে কর্মে অভ্যাসগত গাফিলতি।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঝ) প্রধান পরিদর্শক কর্তৃক অনুমোদিত চাকুরী সংক্রান্ত আত্নশৃংখল বা আচরণসহ, যে কোন বিধির অভ্যাসগত লংঘন।</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ঞ) মালিকের অফিসিয়াল রেকর্ডের রদবদল, জালকরণ, অন্যায় পরিবর্তন, উহার ক্ষতিকরন বা উহা হারাইয়া ফেলা।</p>\r\n<p>আপনি যদি কখনো কোনরুপ অসদাচরণের অপরাধে দোষী প্রমাণিত হন তবে কতৃপক্ষ আপনার বিরুদ্ধে আইনগত শাস্তিমূলক ব্যবস্থা গ্রহণ করিতে পারবে।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>১০। আপনার চাকুরী কোম্পানী কর্তৃক জারিকৃত বিধি ও বাংলাদেশের প্রচলিত শ্রম আইন দ্বারা পরিচালিত হইবে।</p>\r\n<p>১১। কর্তৃপক্ষ আপনাকে প্রয়োজনবোধে এই প্রতিষ্ঠানের যে কোন বিভাগে অথবা বাংলাদেশে অবস্থিত যে কোন কারখানায়/অফিসে বদলি করিতে পারিবেন।</p>\r\n<p>১২। কোম্পানীর যাবতীয় নিয়ম-কানুন পরিবর্তনযোগ্য ( যাহা দেশের প্রচলিত আইনের পরিপন্থি নহে) এবং আপনি পরিবর্তীত নিয়ম কানুন সর্বদা মানিয়া চলিতে বাধ্য থাকিবেন।&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ধন্যবাদান্তে</p>\r\n<p>&nbsp; &nbsp;সংশ্লিষ্ট ব্যবস্থাপক</p>\r\n<p style="text-align: right;">কারখানা কতৃপক্ষ&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp;অনুলিপিঃ</p>\r\n<p>&nbsp; &nbsp;১। হিসাব বিভাগ।</p>\r\n<p>&nbsp; &nbsp;২। ব্যক্তিগত নথি।</p>\r\n<p>আমি অত্র নিয়োগপত্র পাঠ করিয়া এবং ইহাতে বর্ণিত শর্তাদি সম্পূর্ণরুপে অবগত হইয়া এই নিয়োগপত্র গ্রহণ করিয়া স্বাক্ষর করিলাম।</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: right;">&nbsp;শ্রমিকের স্বক্ষর&nbsp; &nbsp; &nbsp; &nbsp;</p>');
